    RegisterViewModel user = new RegisterViewModel();
    IEnumerable<string> Errors;

    private async Task RegisterUser()
    {
        Errors = null;

        var errorList = await accountService.RegisterUserAsync(user);

        if (errorList != null)
        {
            Errors = errorList;
        }
        else
        {
            NavigationManager.NavigateTo("/");
        }
    }

